import React from "react";
import Header from "./component/Header";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  app: {
    width: "80%",
    display: "block",
    margin: "auto",
  },
}));

function App() {
  const classes = useStyles();

  return (
    <div className={classes.app}>
      <Header />
    </div>
  );
}

export default App;
